96dd0bbe-9816-4e09-ae8b-3c83158e114b=The Feedback Module includes pre-made translated Feedback Modal Pop-Up pages and widgets that you can use in your projects. \r\nThis is an alternative way to do translations if you do not wish to use the Batch Translation Tool built into Mendix Studio Pro.\r\n\r\nThe 'ShareFeedback' Page is the main Feedback Form. This form has a submit button and is assigned a nanoflow called 'ACT_SubmitFeedback'.\r\n\r\nThe 'ACT_SubmitFeedback' nanoflow is responsible for sending the feedback to the server and will also open or close a success or failure pop-up.\r\n\r\nYou can find the 'ACT_SubmitFeedback' nanoflow in FeedbackModule > USE_ME folder.\r\n\r\nInside this nanoflow you can customize the Success or Failure pop-ups and the language they render in by changing the Language variable at the start of the nanoflow.
